import { MenuItem } from "./MenuItem";

export const Menu = (props) => {
  const menuItemsList = [
    "about",
    "employees",
    "schedule",
    "news",
    "media",
    "contacts",
  ];
  const menuItemsText = [
    "О студии",
    "Наша команда",
    "Расписание",
    "Новости",
    "Галерея",
    "Контакты",
  ];

  const menuItems = menuItemsList.map((menuItem, key) => {
    console.log(menuItem, menuItemsText[key]);
    return <MenuItem key={key} item={menuItem} text={menuItemsText[key]} />;
  });

  // Верните созданный массив JSX-элементов
  return <>{menuItems}</>;
};
